import React from 'react';
import ProjectCard from '../components/ProjectCard';
import './Projects.css';

// List of all projects with their titles, descriptions, and images
const projects = [
  {
    title: 'Snake Game',
    description: 'A classic Snake game implemented with JavaScript and HTML5 Canvas.',
    image: 'G:\my-portfolio\src\components\snake-game-image.png' // Replace with actual image path or URL
  },
  {
    title: 'SongSift-Rich',
    description: 'A feature-rich application for discovering and recommending music using Spotify API.',
    image: 'G:\my-portfolio\src\components\song-sift-gui-image.png' // Replace with actual image path or URL
  },
  {
    title: 'SongSift-GUI',
    description: 'A graphical user interface for the SongSift application with a polished design.',
    image: 'G:\my-portfolio\src\components\song-sift-gui-image.png' // Replace with actual image path or URL
  },
  {
    title: 'Hagrid-Chatbot',
    description: 'An AI-powered chatbot built with OpenAI’s GPT models for interactive conversations.',
    image: 'G:\my-portfolio\src\components\hagrid-chatbot-image.png' // Replace with actual image path or URL
  },
  {
    title: 'Hagrid-VA',
    description: 'Voice Assistant using OpenAI’s APIs with speech recognition and automation features.',
    image: 'path/to/hagrid-va-image.jpg' // Replace with actual image path or URL
  }
  // Add more projects if needed
];

function Projects() {
  return (
    <div className="projects">
      <h1>My Projects</h1>
      {projects.length > 0 ? (
        projects.map((project, index) => (
          <ProjectCard 
            key={index}
            title={project.title}
            description={project.description}
            image={project.image}
          />
        ))
      ) : (
        <p>No projects available</p>
      )}
    </div>
  );
}

export default Projects;
